objectDesc.p:
							k. 1-19
							Składki zszyte białego, lekko żółtawego, z dobrze widocznymi kresami i żeberkami papieru (pochodzenie holenderskie, różne papiernie) o wymiarach 196x124. Nie zawiera pieczęci Archiwum Filomatów. Znaki wodne: k. 1: prawy górny fragment filigranu „Róg pocztowy”: ucięta w połowie tarcza zwieńczona koroną z lilijkami, z prawej strony wyraźny ozdobnik w kształcie litery S.
k. 2: dolny fragm. tarczy z lilijką, poniżej inicjały CB i mało widoczne L mniejsze względem CB; 
k. 3. fragm.: inicjał D z zygzakiem przypominającym „&” po prawej stronie (k.2 i k.3 stanowią jedną S, oba fragmenty są częścią jednego filigranu); 
k. 4: fragment tarczy zwieńczonej koroną z lilijką; 
k. 5-6 nieczytelne fragmenty inicjałów; 
k. 7 u dołu niewielki fragment przedstawiający część inicjału i prawdopodobnie lilijkę; 
k. 8.: u dołu fragment inicjału D&; 
k. 9: inicjały JH pod nimi Zo (duże Z, małe o); 
k. 10.: w lewym górnym rogu inicjały EN; 
k. 11: u góry fragm.. inicjały Zoon; 
k. 12: fragm.. tarczy z dzwonkiem u dołu, pod spodem inicjały J HO pod nimi &, niżej ONE (to fragment filigranu „Róg pocztowy” z papierni Honiga); 
k. 13: w lewym górnym rogu inicjały HO; 
k. 14-15: stanowią jedną S z niepełnym filigranem „Róg pocztowy” – róg na tarczy zwieńczonej koroną z trzema lilijkami, po obu bokach tarczy symetryczne ozdobniki w kształcie litery S; 
k. 16: u góry inicjały J Ho; 
k. 17: u góry inicjały EN; 
k. 18: u góry inicjały Zoon; 
k.19: u góry inicjały J H. Atrament czarny. SZ oprawiona w niefoliowaną obwolutę (wym. 210x132) ze sztywnego żółtawego papieru. Na obwolucie Cz. atramentem wypisano zawartość SZ, u góry inną ręką, niebieskim atramentem dopisano: 
a)	Po lewej: „IV”, 
b)	Po prawej: „XVII/091. 
U góry ołówkiem: 
a)	Po lewej: „G/1525” (wytarte, prawie nieczytelne), poniżej „6/1628”, 
b)	Po środku ołówkiem współczesną ręką „k. 10-28” przekreślone, 
c)	Po lewej wyblakłym niebieskim długopisem, ręką współczesną „K. 19”. 
W tekście podkreślenia niebieską kredką. W p. 6 do inicjałów A.M. dopisano inną ręką, niebieską kredką „icki”. 
D postrzępiony lewostronnie, przetarcia na taśmie konserwatorskiej; szycie solidne, jedynie po środku SZ; papier dobrej jakości, holenderski, różnej grubości w zależności od papierni, 
k. 19v – vacat.
